import Information from './Information';
import Map from './Map';
import SearchBar from './SearchBar';

function App() {
  return (
    <>
        <div className="detail">
            <h3 className="detail__title">IP Address Tracker</h3>
            <SearchBar/>
            <Information/>
        </div>
        <Map/>
    </>
  );
}

export default App;
